import React from "react";
import "./pages.css"

const Pages = ({ handlePagesClick }) => {
    return (
        <div className="pokeButtons">
            <button
                onClick={() => handlePagesClick("prev")}
                className="paginationBtn"
            >
            </button>

            <button
                onClick={() => handlePagesClick("next")}
                className="paginationBtn"
            >
            </button>
        </div>
    );
};
export default Pages;
